import logging
import asyncio

from aiogram.utils import executor

from loader import dp, bot, ADMIN
import handlers
from data import Base, engine
from middlewaries import UserMiddleware

async def on_start(event):
    print("Bot has started")
    logging.basicConfig(level=logging.ERROR, filename="log.txt")
    dp.middleware.setup(UserMiddleware())
    #Base.metadata.drop_all(engine)
    Base.metadata.create_all(engine)
    

async def main():
    try:
        await on_start(dp)  # Execute the on_start function before starting the polling
        await dp.start_polling()
    except Exception as e:
        await bot.send_message(
            ADMIN,
            f"Бот упал, ошибка:\n {e}"
        )

if __name__ == "__main__":
    loop = asyncio.get_event_loop()
    loop.run_until_complete(main())




